import React, {useState, useEffect} from 'react';
import Axios from 'axios';
import {Link} from "react-router-dom";

import "./RSNav.css";


export default function RSNav() {  
    const [taglist, GetTagList] = useState([])

    Axios.get("http://localhost:3001/tag/get").then((response) => {
                        GetTagList(response.data)
                    })
    return ( 
        <div className="right-side-nav">
            <div>
                <h3>Trending Tags</h3>
            </div>
            <div className="rs-tag-list">
                    {taglist.map((val) => {
                        return (
                        <>
                            <div className="row">
                                <label>{val.tagcount}<button onClick={() => TagLink(val.tag)}>{val.tag}</button></label>
                            </div>
                        </>
                        )
                    })}
                </div>
        </div>
    )
}
